import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to trigger the profile view
    // Using a text-based selector to find the link
    const profileLink = page.locator('a:has-text("Your Profile")').first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_profile_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_profile_click.png'));

    // Wait for the profile section to be rendered on the page
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_visible.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();

    // Extract profile stats
    const stats = await page.locator('.profile-stats .stat').evaluateAll(elements =>
      elements.map(el => {
        const number = el.querySelector('.stat-number')?.textContent.trim();
        const label = el.querySelector('.stat-label')?.textContent.trim();
        return { [label]: number };
      })
    );

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      stats: Object.assign({}, ...stats)
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
